customCSS:
#thread-watcher, #updater, .dialog:not(#qr):not(#thread-watcher):not(#header-bar), #qr-filename-container {
  background: #000000 !important;
}
#qr {
  background: #000000 !important;
  border: 1px solid #101010 !important;
}
#qr .captcha-counter > a {
  filter: invert(100%) hue-rotate(180deg) !important;
}
#qr {
  max-width: 50px !important;
}
#file-n-submit > input, #qr-draw-button {
  border-radius: 0px !important;
}

.postInfo {
  padding-left: 7px !important;
}

.highlight-youQuotes:root .qmark-you {
  font-weight: normal !important;
}

.desktop.navLinksBot.navLinks {
  opacity: 0 !important;
  margin-top: -10px !important;
}
